import React, { useState, useEffect } from "react";
import { Route, NavLink, json, useNavigate } from "react-router-dom";
import { Signup } from "./signup";
import '../componentCss/home.css';


export function Home() {
  const navigate = useNavigate()
  const [email, setEmail] = useState("")
  const [password, setPassword] = useState("")

  const handelSubmit = async (e)=>{
    e.preventDefault();
    if(!email)return status
    let obj = { email: email, password: password }
    let result = await fetch("http://localhost:5000/api/accounts/login", {
      method: "POST",
      headers: { Accept: 'application/json', 'Content-Type': 'application/json' },
      body: JSON.stringify(obj)
    })

    result = await result.json()
    if (result.status) navigate('/signup')
    console.log(result)

  }


  return (
    <div className="homeBox" >
      <div> Wellcome </div>

      <form  >
        <label> email</label>
        <input type="email" value={email} required onChange={(e) => { setEmail(e.target.value) }} />
        <br />

        <label>password</label>
        <input type="password" value={password} required onChange={(e) => { setPassword(e.target.value) }} />
        <br />
        <input type="submit" value="submit" onClick={handelSubmit} />
      </form>

    </div>

  )
}
